import React, { useState } from 'react';
import { StyleSheet, Text, View, TextInput, Button } from 'react-native';

const App = () => {
  const [nome, setNome] = useState('');
  const [genero, setGenero] = useState('');
  const [dataNascimento, setDataNascimento] = useState('');
  const [usuario, setUsuario] = useState('');
  const [senha, setSenha] = useState('');
  const [email, setEmail] = useState('');
  const [confirmarEmail, setConfirmarEmail] = useState('');
  const [cpf, setCpf] = useState('');
  const [idioma, setIdioma] = useState('');
  const [dados, setDados] = useState(null);

  const handleCadastro = () => {
    const dadosCadastro = {
      nome,
      genero,
      dataNascimento,
      usuario,
      senha,
      email,
      confirmarEmail,
      cpf,
      idioma,
    };
    setDados(dadosCadastro);
    console.log(dadosCadastro);
  };

  return (
    <View style={styles.container}>
        <Text>Nome:</Text>
        <TextInput
          style={styles.input}
          onChangeText={(text) => setNome(text)}
          value={nome}
        />
        <Text>Genero:</Text>
        <TextInput
          style={styles.input}
          onChangeText={(text) => setGenero(text)}
          value={genero}
        />
        <Text>Data de Nascimento:</Text>
        <TextInput
        style={styles.input}
        onChangeText={(text) => setDataNascimento(text)}
        value={dataNascimento}
      />
      <Text>Usuário:</Text>
      <TextInput
        style={styles.input}
        onChangeText={(text) => setUsuario(text)}
        value={usuario}
      />
      <Text>Senha:</Text>
      <TextInput
        style={styles.input}
        onChangeText={(text) => setSenha(text)}
        value={senha}
        secureTextEntry={true}
      />
       <Text>E-mail:</Text>
      <TextInput
        style={styles.input}
        onChangeText={(text) => setEmail(text)}
        value={email}
        keyboardType="email-address"
      />
      <Text>Confirme seu E-mail:</Text>
      <TextInput
        style={styles.input}
        onChangeText={(text) => setConfirmarEmail(text)}
        value={confirmarEmail}
        keyboardType="email-address"
      />
       <Text>CPF:</Text>
      <TextInput
        style={styles.input}
        onChangeText={(text) => setCpf(text)}
        value={cpf}
        keyboardType="numeric"
      />
      <Text>Idioma do Currículo:</Text>
      <TextInput
        style={styles.input}
        onChangeText={(text) => setIdioma(text)}
        value={idioma}
      />
      <Button title="Cadastrar" onPress={handleCadastro}/>

        {dados && (
           <View style={styles.dadosContainer}>
           <Text>Dados informados:</Text>
           <Text>{`Nome: ${dados.nome}`}</Text>
           <Text>{`Gênero: ${dados.genero}`}</Text>
           </View>
      )}
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
    justifyContent: 'center',
  },
  input: {
    height: 40,
    borderColor: 'gray',
    borderWidth: 1,
    marginBottom: 10,
  },
  dadosContainer: {
    marginTop: 20,
  },
});

export default App;
